import './App.css';

const calculate = (a, b) => {
  const add = a + b;
  const subtract = a - b;
  const multiply = a * b;
  const divide = a / b;

  return [add, subtract, multiply, divide];
}

const App = () => {
  const myArr = ['Mango', 'Apple', 'Orange', 'Banana'];
  const [add, subtract, multiply, divide] = calculate(4, 7);

  return (
    <ul>
      {myArr.map((element) => <li>{element}</li>)}
    </ul>

  );
}

export default App;
